import { Fragment } from 'react';
import Header from '../components/Header';
import RedBackdrop from '../components/RedBackdrop';

const Index = () => {
	return (
		<Fragment>
			<Header />
			<SignInModal />
			<RedBackdrop />
		</Fragment>
	);
};

export default Index;
